package image

import (
	"fmt"
	"github.com/comeonjy/go-baiduai/lib"
	"testing"
)

var i *Image

var base64Image string

func init() {
	i = New(lib.IMAGE_API_KEY, lib.IMAGE_SECRET_KEY)
	base64Image = ""
}

func TestImage_Advanced(t *testing.T) {
	attr, err := i.Advanced(&AdvancedReq{
		Image: base64Image,
	})
	fmt.Printf("%+v \n %+v", attr, err)
}
